INSERT INTO `activities` VALUES (2,NULL,'EXPERT ?','assets/uploads/activities/46181646040595.jpg','Are you brave enough to walk on some wooden logs supported with nothing but a pair of ropes, or hang on a climbing wall at a height of around 30 meters? One thing is certain to be said, this course is not for the faint-hearted, but once you get it over with, nothing more can stand in your way.','2022-03-28 09:23:18','2022-02-28 09:29:55'),(3,'OR JUST','SKILLED ?','assets/uploads/activities/29401646040675.jpg','This course is designed to put your physical and mental skills up to the test. A challenge that would make your mind erupt with joy and your heart with pleasure. Your knees might be shaking but a smile is certain to stay put on your face.','2022-03-27 09:23:18','2022-02-28 09:31:15'),(4,'MAYBE YOU\'RE A','NOVICE ?','assets/uploads/activities/36491646040722.jpg','If you are still a newbie when it comes to climbing and hanging on ropes, or if you just need a warmup prior to going rough. the orange course is your best choice. Here, you can test your skills before going wild on a tougher and higher level.','2022-03-26 09:23:18','2022-02-28 09:32:02'),(5,'I AM JUST A','JUNIOR  !','assets/uploads/activities/71351646040771.jpg','Who said adventure is only for adults?! Sky Park has a special course designed with our little, beloved ones in mind, offering them the same challenging experience but with a touch of simplicity.','2022-03-25 09:23:18','2022-02-28 09:32:51');
