INSERT INTO `general_settings` VALUES (1,1250,'assets/uploads/46121646213984.png','Sky Park',1.14,1,1.14,1,'اتفاق علي اقرار و مخالصة و ابراءات\r\nفي العقد وأنظمة السلامة ؛ 3.1.2. الحصول على معدات السلامة ذات الجودة المناسبة ، المشار إليها في البند 4.1.2 من العقد ، واللازمة لاستخدام دورات الحبل ؛ 3.1.3. تلقي معلومات حول استخدام دورات Rope بأمان من مدربي Park. 3.2 يجب على الضيف والأشخاص المرافقين: 3.2.1. التصرف واستخدام دورات الحبل بحكمة ، بحذر وأمان ، 3.2.2. قبل البدء في استخدام دورات الحبل : أ) التعرف على لوائح السلامة ؛ ب) الاستماع إلى التعليمات الموجزة (\"الإحاطة\") ؛ و ج) التأكد من أن المرافقين على دراية بلوائح السلامة ، 3.2.3. اتبع التعليمات الإلزامية من قبل مدرب الحديقة. 3.2.4. إعادة جميع معدات السلامة وغيرها من المعدات في حالة مماثلة كما تم توفيرها للضيف والمرافقين وكما. مؤكدًا من خلال إدخال السجل وتوقيع مدرب الحديقة في نهاية العقد.\r\n\r\n3.3 بتوقيع هذا العقد، يؤكد الضيف أن: 3.3.1  الشركة ليست على علم بأي مشاكل صحية أو ظروف أخرى يعاني منها هو / هي أو الأشخاص المرافقون والتي من شأنها أن تمنعهم من استخدام دورات الحبل بأمان أو التي قد تسبب ضررًا لحياة الضيف وصحته و / أو ممتلكاته. و / أو الشركة و / أو الأطراف الثالثة من خلال تصرفات أو تقاعس الضيف و / أو الأشخاص المصحوبين.   تم تزويده / هي والأشخاص المصحوبين بمعدات السلامة التي تبدو بصريًا في حالة فنية جيدة ويلتزمون باستخدامها بأمان ووفقًا للتعليمات المستلمة. يؤكد الضيف أن عدد مجموعات معدات السلامة التي حصل عليها يتوافق مع العدد الموضح في الجدول.   3.3.3 يتفهم / يقر ويوافق على أن نشاط تسلق الكابلات والحبال والشبكات والمنصات وخطوط الانزلاق وغيرها من التركيبات من قبل الشركة (باستخدام دورات Rope وغيرها من الأنشطة) هو نشاط بالغ الخطورة يقوم به / هي عن علم ، طواعية وبإرادة حرة ، وبالتالي تتحمل جميع المخاطر والمسؤولية عن أي كدمات وإصابات وأضرار أخرى تلحق بالصحة وفقدان الأرواح وكذلك الأضرار التي لحقت بممتلكات الضيف والأشخاص المرافقين و / أو الأطراف الثالثة ، باستثناء تلك الحالات عندما يحدث ذلك بسبب خطأ الشركة.\r\n\r\n4. حقوق والتزامات الشركة 4.1  مطلوب من الشركة: 4.1.1 تقديم موجز للضيف والأشخاص المرافقين قبل أن يبدأوا في استخدام دورات Rope وكذلك توفير فرصة لاختبار استخدام المعدات في الممارسة العملية ؛ 4.1.2  زود الضيف والأشخاص المرافقين بمعدات السلامة بالشكل المناسب: أحزمة قابلة للتعديل (\"النظام\") بحبلين مرتبطين بكل منهما (أو حبل واحد وكاربين متصل بكابل الأمان في في جميع الأوقات) والحبل الثالث الذي يحتوي على كاربين بكرة خط مضغوط متصل به (مخصص للطيران على الكابل شخص واحد في كل مرة ، ومميز باللونين الأحمر والأزرق) (\"معدات السلامة\") بعد أن يدفع الضيف الدفعة إلى الشركة والتعرف على لوائح السلامة. 4.1.3  للتأكد من أن مسار الحبال ، فإن العوائق والمعدات الموجودة فيه في شكل مناسب. \r\n\r\n4.2  يحق للشركة: 4.2.1 منع الضيف و / أو الأشخاص المصحوبين من استخدام دورات الحبل إذا: 4.2.1.1  لم يدفع الضيف الدفعة ؛ 4.2.1.2 انتهك الضيف أو الأشخاص المصحوبين جزئيًا أو كليًا البند 3.2 و / أو 7 من العقد ؛ 4.2.2  تزويد الضيف والأشخاص المرافقين بتعليمات إلزامية حول كيفية استخدام دورة الحبل وحول السلامة. 4.2.3 الحقوق الأخرى المنصوص عليها في العقد\r\n\r\n5. إنهاء العقد 5.1  يحق لموظف الشركة (مدرب أو مدير الحديقة) إنهاء العقد وإزالة الضيف والأشخاص المرافقين من دورة الحبل دون أي تحذير منفصل في حالة انتهاك الضيف للعقد بشكل أساسي. 5.2  يعتبر انتهاك العقد أمرًا أساسيًا إذا كان الضيف و / أو الأشخاص المرافقون: 5.2.1 . لم تدفع الدفعة وفقًا للإجراءات الموضحة في هذا العقد ؛ 5.2.2. انتهكت كليًا أو جزئيًا البند 3.2 و / أو الأحكام الواردة في البند 7 من العقد ؛ 5.2.3  حالات أخرى عندما يشكل الضيف و / أو الأشخاص المرافقون تهديدًا لأنفسهم و / أو أطراف ثالثة و / أو ممتلكات الشركة أثناء استخدام دورة الحبل. 5.3  في حالة إنهاء العقد للأسباب الموضحة في البند 5.1 ، لا يتم إرجاع الدفع إلى الضيف. 5.4 يمكن للطرفين أيضًا إنهاء العقد في الحالات التي لا يمكن فيها استخدام مسار الحبل بأمان بسبب الظروف الجوية (على سبيل المثال ، الرياح القوية ، والأمطار القوية ، والعواصف ، والرعد ، والإضاءة ، وما إلى ذلك - الظروف الجوية السيئة) أو ظروف أخرى لا يوجد فيها أي من الطرفين مسؤول. في مثل هذه الحالة ، تكون الشركة ملزمة بالسماح للضيف باستخدام دورة Rope في أوقات أخرى يتفق عليها الطرفان. 5.5  يتم إرجاع المبلغ بالكامل إلى العميل فقط في الحالات التالية: أ) إنهاء العقد بسبب انتهاك الشركة للعقد ؛ أو ب) أنهى الضيف العقد قبل البدء في استخدام البنية التحتية للمنتزه. 5.6  إذا أنهى الضيف العقد أثناء استخدام دورة الحبل الأخضر أو ​​بعده مباشرة / دورة الحبل الأول للأطفال لأسباب تتعلق بالحالة الصحية أو الجسدية أو النفسية للضيف و / أو الأشخاص المصحوبين بسبب عدم تمكنهم من الوصول بأمان باستخدام دورات Rope ، يتم إرجاع الدفع المتناسب مع الوقت غير المستخدم إلى الضيف بعد خصم التكاليف المعقولة الأخرى التي تكبدتها الشركة قبل الإعلان عن إنهاء العقد.\r\n\r\n6. المسؤولية 6.1 الضيف مسؤول عن الإجراءات و / أو التقاعس عن التصرف في مسار الحبل من قبله / هي والأشخاص المرافقين له / لها ، ويلتزم بتعويض جميع الأضرار (للشركة والأطراف الثالثة) التي حدثت بسبب هذه الإجراءات و / أو التقاعس عن التصرف. و 6.2 الضيف ملزم بتعويض الضرر الذي لحق بالشركة في الحالات التي يكون فيها مسار الحبل ، والمعدات الموجودة فيه وكذلك معدات السلامة التي توفرها الشركة تالفة أو مفقودة بسبب ظروف لا تكون الشركة مسؤولة عنها. 6.3 من خلال توقيع العقد ، يتفهم الضيف ويتحمل جميع المسؤوليات المتعلقة باستخدام دورات Rope. لا تتحمل الشركة أي مسؤولية عن الكدمات والإصابات وغيرها من المشكلات الصحية أو حالات فقدان الحياة وكذلك / أو تلف الملابس والأحذية وأي ممتلكات أخرى من قبل الضيوف والمرافقين أثناء استخدام دورات Ropes ، باستثناء تلك الحالات عندما يحدث ذلك بسبب خطأ الشركة. 6.4. لا تتحمل الشركة أي مسؤولية عن الكدمات والإصابات وغيرها من المشكلات الصحية أو حالات فقدان الحياة بالإضافة إلى / أو تلف الملابس والأحذية وأي ممتلكات أخرى من قبل الضيف والأشخاص المرافقين عند حدوث ذلك أثناء استخدام دورة الحبل في الحالات التي لا يلتزم الضيف و / أو الأشخاص المصحوبون بلوائح السلامة وكذلك الإرشادات والتوصيات حول السلوك في دورة Rope المقدمة أثناء الإحاطة.\r\n\r\n7. قواعد السلامة 7.1 يتعين على كل ضيف ومرافق له التعرف على لوائح السلامة واتباعها (بالإضافة إلى اللوائح المعروضة علنًا في المتنزه والمرفقة بهذا العقد) قبل البدء في استخدام دورات Rope والامتثال لها عند زيارة المتنزه. يجب على كل ضيف و / أو مرافقين: 7.1.1. توقف (لا تقم بأفعال يشعرون بعدم اليقين بشأنها) ؛ 7.1.2. اتصل / اسأل عن مدرب الحديقة ؛ 7.1.3. انتظر مدرب الحديقة. 7.1.4. طرح أسئلة على مدرب الحديقة حول كيفية التصرف بشكل مناسب في الموقف الذي يشعر الضيف بعدم اليقين فيه ؛ 7.1.5. استمر في التسلق في دورة Rope باتباع تعليمات مدرب Park أو اطلب من مدرب Park مساعدة الضيف و / أو الأشخاص المرافقين على النزول من مسار Rope إلى الأرض.    \r\n\r\n8. أحكام أخرى 8.1 يؤكد الضيف أن البيانات التي قدمها صحيحة وعلى مسؤوليته. يوافق الضيف على أن البيانات المقدمة عنه / عنها وعن الأشخاص المصحوبين يتم استخدامها وإدارتها لأغراض تنفيذ هذا العقد وفقًا لسياسة الخصوصية المعروضة علنًا في موقع الشركة على الويب (www.unoparks.lt). 8.2 العقد ساري المفعول من لحظة التوقيع حتى التنفيذ الكامل للالتزامات من قبل الطرفين. 8.3 يتفق الطرفان على حل جميع الخلافات عن طريق المفاوضات المتبادلة وفي حالة استحالة التوصل إلى اتفاق - عن طريق تسوية المنازعات خارج المحكمة التي تنظر فيها دائرة حماية حقوق المستهلك الحكومية و / أو في محكمة جمهورية ليتوانيا المختصة وفقًا للإجراءات التي أنشأتها القوانين القانونية لجمهورية ليتوانيا. 8.4 يتم إبرام العقد في نسخة واحدة ، موقعة من قبل الطرفين وتبقى مع الشركة. جميع الملحقات جزء لا يتجزأ من العقد.\r\n\r\nبتوقيع العقد ، يؤكد الضيف أن: 1-   - يوافق على أن يتم تصويره و / أو تصويره أثناء استخدام دورات الحبال وكونه منطقة المنتزه ، وأنه يمكن استخدام صوره / صورها و / أو المواد التي تم تصويرها دون موافقة منفصلة (ما لم ينص العقد على خلاف ذلك) في النشاط التجاري لـ الشركة ، بما في ذلك على سبيل المثال لا الحصر التسويق والاتصالات. يمكن للضيف الإشارة إلى عدم موافقته عن طريق تحديد المكان في هذا البند من العقد:لا أوافق على استخدام الشركة لصوري ☐2-    أن يكون على دراية بنود العقد ، بما في ذلك لوائح السلامة ، ويجدها واضحة ومفهومة ؛ قام بشرح وتقديم الأشخاص المصحوبين بأحكام العقد ، بما في ذلك لوائح السلامة ؛ أنه / هي ملزم بالامتثال لبنود العقد ، بما في ذلك لوائح السلامة ، والتأكد من امتثال الأشخاص المصحوبين لها أيضًا .حصل هو / هي والأشخاص المرافقون (كل واحد منهم) على معدات أمان في شكل تقني مناسب: حزام تسلق قابل للتعديل بحبلين مرتبطين بهما كاربين أمان (أو حبل واحد وكاربين متصل بكابل الأمان في في جميع الأوقات) ، بالإضافة إلى الحبل الثالث الذي يحتوي على كاربين بكرة خط مضغوط متصل به (مخصص للهبوط (الطيران / السحاب). قيمة كل مجموعة - 200 يورو (أو 300 يورو ، إذا كانت عبارة عن جهاز بحبل واحد وكاربين متصل بكابل الأمان في جميع الأوقات).4-   - أرغب في تلقي معلومات حول الأخبار والخدمات التي تقدمها UNO Parks ☐ بريد إلكتروني:\r\n\r\nمن خلال توقيع العقد ، يفهم الضيف ويقبل ويوافق على أن تسلق الكابلات والحبال والشبكات والمنصات وخطوط الانزلاق وغيرها من التركيبات من قبل الشركة (باستخدام دورات الحبال وغيرها من الأنشطة) هو نشاط بالغ الخطورة يقوم به / هي عن علم ، طواعية وبإرادة حرة ، وبالتالي تتحمل جميع المخاطر والمسؤولية عن أي كدمات وإصابات وأضرار أخرى تلحق بالصحة وفقدان الأرواح وكذلك الأضرار التي لحقت بممتلكات الضيف والأشخاص المرافقين و / أو الأطراف الثالثة ، باستثناء تلك الحالات عندما يحدث ذلك بسبب خطأ الشركة.\r\n\r\nاقرأ الطرفان وفهما العقد ؛ وافقوا على أنه يتوافق مع نواياهم الحقيقية ووقعوا عليه. يؤكد الضيف أيضًا أن بنود العقد قد تم شرحها له / لها وأنها واضحة ومفهومة وأنه / لها الحق والتفويض لتوقيع العقد.\r\n\r\nيتم حل نزاعات المستهلك بأمر غير قضائي من قبل قانون حماية حقوق المستهلك وفقا للقانون المصري تسجيل الدخول بشأن إعادة معدات السلامة ونهاية التسلق تم إرجاع معدات السلامة في حالة مناسبة في ____________.\r\n\r\nAny dispute or claim arising out of or in connection with this website shall be governed and construed in\r\naccordance with the laws of Egypt.\r\n\r\nEgypt is our country of domicile and stipulate that the governing law is the local law.\r\n\r\nCustomer using the website who are Minor /under the age of 18 shall not register as a User of the website and shall not transact on or use the website.\r\n\r\nWe accept payments online using Visa, MasterCard and Meeza credit/debit card in EGP.\r\n\r\nThe cardholder must retain a copy of transaction records and Merchant policies and rules.\r\n\r\nThe Website Policies and Terms & Conditions may be changed or updated occasionally to meet the requirements and standards. Therefore the Customers’ are encouraged to frequently visit these sections in order to be updated about the changes on the website. Modifications will be effective on the day they are posted.','At Sky Park, your courage will be put to test. Nothing can satisfy your lust for adventure as a set of professional obstacle courses elevated on three levels. and the higher up you go, the more challenging it will get. So, take a deep breath and set your sails towards Sky Park to prove yourself the ultimate champ.\r\n\r\nObstacle courses are established on four levels, Junior, Novice, Intermediate, and Expert. Each path goes another level higher than the one before and features some more challenging obstacles. No, we didn’t forget about our little ones. Children up to 5 years old have their own special route with obstacles tailored to match their age. Once you succeed to complete your mission and reach the finish line, your lips won’t refrain from keeping a smile on hold for the next couple of days.','Westown hub،, Beverly Hills,Al-Sheikh Zayed, Giza Governorate','01223303786','(+20) 105-080-9110','(+20) 1061844465','info@skypark.fun','sales@skypark.fun','https://www.twitter.com','https://www.facebook.com','https://www.instagram.com','https://www.snap.com','23:55:06',NULL,'2022-06-26 13:26:13');
